import React, { useState, useEffect } from 'react';
import './global.css';
import './App.css';
import './Sidebar.css';
import './Main.css';

// Componente: Bloco isolado de HTML, CSS, JS, o qual não interfere no restante da aplicação
// Propriedade: Informações que um componente PAI passa para o componente FILHO
// Estado: Informações mantidas pelo componente (Lembrar: Imutabilidade)

import Header from './Header';

function App() {
  const [latitude, setLatitude] = useState('');
  const [longitude, setLongitude] = useState('');
  useEffect(() => {
    navigator.geolocation.getCurrentPosition(
      (position) => {
        const { latitude, longitude } = position.coords;
        setLatitude(latitude);
        setLongitude(longitude);
      },
      (err) => {
        console.log(err);
      },
      {
        timeout: 30000,
      }
    );
  }, []);

  return (
    <div id="app">
      <aside>
        <strong>Cadastar</strong>
        <form>
          <div className="input-block">
            <label htmlFor="github_username">Usuário do Github</label>
            <input name="github_username" id="github_username" required/>
          </div>

          <div className="input-block">
            <label htmlFor="techs">Tecnologias</label>
            <input name="techs" id="techs" required/>
          </div>

          <div className="input-group">
            <div className="input-block">
              <label htmlFor="latitude">Latitude</label>
              <input type="number" name="latitude" id="latitude" required value={latitude} />
            </div>

            <div className="input-block">
              <label htmlFor="longitude">Longitude</label>
              <input type="number" name="longitude" id="longitude" required value={longitude} />
            </div>
          </div>

          <button type="submit">Salvar</button>
        </form>
      </aside>
      <main>
        <ul>
          <li className="dev-item">
            <header>
              <img src="https://avatars0.githubusercontent.com/u/31678376?s=460&v=4" alt="Matheus Henrique"/>
              <div className="user-info">
                <strong>Matheus Henrique</strong>
                <span>C, C++, C#, Java, NodeJS</span>
              </div>
            </header>
            <p>Computer Science student, game-dev enthusiast</p>
            <a href="https://github.com/HonoredPrince">Acessar Perfil no Github</a>
          </li>
          <li className="dev-item">
            <header>
              <img src="https://avatars0.githubusercontent.com/u/31678376?s=460&v=4" alt="Matheus Henrique"/>
              <div className="user-info">
                <strong>Matheus Henrique</strong>
                <span>C, C++, C#, Java, NodeJS</span>
              </div>
            </header>
            <p>Computer Science student, game-dev enthusiast</p>
            <a href="https://github.com/HonoredPrince">Acessar Perfil no Github</a>
          </li>
          <li className="dev-item">
            <header>
              <img src="https://avatars0.githubusercontent.com/u/31678376?s=460&v=4" alt="Matheus Henrique"/>
              <div className="user-info">
                <strong>Matheus Henrique</strong>
                <span>C, C++, C#, Java, NodeJS</span>
              </div>
            </header>
            <p>Computer Science student, game-dev enthusiast</p>
            <a href="https://github.com/HonoredPrince">Acessar Perfil no Github</a>
          </li>
          <li className="dev-item">
            <header>
              <img src="https://avatars0.githubusercontent.com/u/31678376?s=460&v=4" alt="Matheus Henrique"/>
              <div className="user-info">
                <strong>Matheus Henrique</strong>
                <span>C, C++, C#, Java, NodeJS</span>
              </div>
            </header>
            <p>Computer Science student, game-dev enthusiast</p>
            <a href="https://github.com/HonoredPrince">Acessar Perfil no Github</a>
          </li>
        </ul>

      </main>
    </div>
  );
}

export default App;
